BEGIN TRANSACTION;

drop schema if exists releves_notes cascade;
create schema releves_notes;
set search_path to releves_notes;

CREATE TABLE valnotes(
  note char(3) primary key,
  valeur numeric
);
CREATE TABLE titres(
  sigle char(10) primary key,
  titre varchar(45)
);
CREATE TABLE credits(
  sigle char(10) primary key,
  credits numeric,
  foreign key (sigle) references titres(sigle)
);
CREATE TABLE programmes(
  prog char(7)  primary key,
  description varchar(200)
);
CREATE TABLE notes 
  (trimc char(5), sigle char(10), matricule char(10), prog char(7), nature char(3), note char(3),
    primary key (trimc,sigle,matricule),
    foreign key (sigle) references titres(sigle),
    foreign key (note) references valnotes(note),
    foreign key (prog) references programmes(prog));

COMMIT;
